'WITH CT AS (SELECT DECODE(ROWNUM,1,''area-spline'',2,''bar'',3,''pie'',4,''line'',5,''bubble'',6,''donut'') AS CHART_TYPE FROM DUAL CONNECT BY ROWNUM<=6)',
'SELECT JSON_OBJECT( ',
'--title of the item',
'''title'' VALUE ''This is a ''||CHART_TYPE||'' chart'',',
'--width of chart betw. 1 and 12',
'''colSpan'' VALUE 6,',
'--height',
'''height'' VALUE 400,',
'--configuration for chart',
'''itemConfig'' VALUE JSON_OBJECT(',
' --gauge min',
' ''gaugeMin'' VALUE NULL,',
' --gauge max',
' ''gaugeMax'' VALUE NULL,',
' --type (single,multi)',
' ''gaugeType'' VALUE ''single'',',
' --full circle [1,0]',
' ''gaugeFullCircle'' VALUE 0,',
' --Add x grid lines [1,0]',
' ''gridX'' VALUE 1,',
' --Add y grid lines [1,0]',
' ''gridY'' VALUE 1,',
' --Bottom padding (height) of the x axis [num]',
' ''xAxisHeight'' VALUE 0,',
